import { Component, Fragment } from "react";
import React from "react";
import { Link } from "react-router-dom";

class CardMeusAgendamentos extends React.Component {
  state = {
    contract: null
  };

  constructor(contract) {
    super();
    this.state.contract = contract;
  }

  render() {
    return (
      <div className="col-sm-3 ml-5 mr-5 mt-4 d-flex align-items-stretch">
        <div className="card h-25">
          <div class="card">
            <div class="card-header">Quote</div>
            <div class="card-body">
              <blockquote class="blockquote mb-0">
                <p>
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                  Integer posuere erat a ante.
                </p>
                <footer class="blockquote-footer">
                  Someone famous in{" "}
                  <cite title="Source Title">Source Title</cite>
                </footer>
              </blockquote>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default CardMeusAgendamentos;
